export const buildHistoryItem = (setting: Setting): HistoryValue => {
  const user = _sample(admins);
  return {
    id: Math.ceil(Math.random() * 1000),
    value: setting.value,
    user: {
      id: user.id,
      name: user.name
    },
    created_at: setting.last_update
  };
};
